import './assets/FormCrearEvento.css';

const ModalSalir = ({ message, onClose=setMostrarModalOpss}) => {

  return (
    <div className='modal-container' >
      <div className='modalCrearEvento4'>
      <div className="FondoModal4">
            <h2 className="CrearEvento">{message}</h2>
          </div>
          <div className="FondoModal4">
            <div className='TextoModal'>
                <h2 className="CrearEvento1">
                    Aqui deberia aparecer una imagen
                </h2>
            </div>
            
          <div className="ConfbuttonRequisitos">
              <button className="buttonRequisitos2" type="button" onClick={setMostrarModalOpss(false)}>
                Volver a la Creacion
              </button>
            </div>
        </div>
      </div>
    </div>
  );
};

export default ModalSalir;
